import React, { useState, useEffect } from 'react';
import {
  Card,
  Row,
  Col,
  Statistic,
  Table,
  Tag,
  Button,
  Switch,
  Alert,
  Timeline,
  Progress,
  Space,
  Tooltip,
  Modal,
  Typography,
  Tabs,
  List,
  Avatar,
  Badge,
  notification
} from 'antd';
import {
  RobotOutlined,
  BugOutlined,
  CheckCircleOutlined,
  ExclamationCircleOutlined,
  ReloadOutlined,
  SettingOutlined,
  EyeOutlined,
  ThunderboltOutlined,
  ClockCircleOutlined,
  WarningOutlined
} from '@ant-design/icons';
import aiErrorMonitor from '../services/errorMonitor';
import api from '../services/api';

const { Title, Text, Paragraph } = Typography;
const { TabPane } = Tabs;

const AIDashboardPage = () => {
  const [loading, setLoading] = useState(true);
  const [aiStats, setAiStats] = useState({});
  const [recentErrors, setRecentErrors] = useState([]);
  const [isAutoFixEnabled, setIsAutoFixEnabled] = useState(true);
  const [selectedError, setSelectedError] = useState(null);
  const [modalVisible, setModalVisible] = useState(false);

  useEffect(() => {
    loadDashboardData();
  }, []);

  const loadDashboardData = async () => {
    try {
      setLoading(true);
      const report = aiErrorMonitor.generateReport();
      setAiStats(report);
      const errors = aiErrorMonitor.getRecentErrors(20);
      setRecentErrors(errors);
    } catch (error) {
      console.error('Error loading dashboard data:', error);
    } finally {
      setLoading(false);
    }
  };

  const handleAutoFixToggle = (enabled) => {
    setIsAutoFixEnabled(enabled);
    aiErrorMonitor.setAutoFix(enabled);
    notification.success({
      message: 'AI Auto-Fix Updated',
      description: `Auto-fix has been ${enabled ? 'enabled' : 'disabled'}`
    });
  };

  const handleTriggerTest = () => {
    console.error('ðŸ§ª Test Error: This is a test error for AI monitoring');
    notification.info({
      message: 'Test Error Triggered',
      description: 'Check the console to see AI analysis'
    });
    setTimeout(loadDashboardData, 2000);
  };

  return (
    <div style={{ padding: '24px', background: '#f0f2f5', minHeight: '100vh' }}>
      <div style={{ marginBottom: '24px' }}>
        <Title level={2}>
          <RobotOutlined style={{ marginRight: '8px', color: '#1890ff' }} />
          AI Error Monitor Dashboard
        </Title>
        <Paragraph>
          Real-time error detection, AI analysis, and automatic fixes for your POS system
        </Paragraph>
      </div>

      <Row gutter={[16, 16]} style={{ marginBottom: '24px' }}>
        <Col xs={24} sm={12} md={6}>
          <Card>
            <Statistic
              title="AI Monitoring"
              value={aiStats.summary?.monitoring ? "Active" : "Inactive"}
              valueStyle={{ 
                color: aiStats.summary?.monitoring ? '#3f8600' : '#cf1322',
                fontSize: '20px'
              }}
              prefix={<RobotOutlined />}
            />
            <div style={{ marginTop: '8px' }}>
              <Switch 
                checked={isAutoFixEnabled}
                onChange={handleAutoFixToggle}
                checkedChildren="Auto-Fix ON"
                unCheckedChildren="Auto-Fix OFF"
              />
            </div>
          </Card>
        </Col>
        
        <Col xs={24} sm={12} md={6}>
          <Card>
            <Statistic
              title="Errors Detected (24h)"
              value={aiStats.summary?.recent24h || 0}
              valueStyle={{ color: '#cf1322' }}
              prefix={<BugOutlined />}
            />
          </Card>
        </Col>
        
        <Col xs={24} sm={12} md={6}>
          <Card>
            <Statistic
              title="Total Errors"
              value={aiStats.summary?.totalErrors || 0}
              valueStyle={{ color: '#1890ff' }}
              prefix={<ExclamationCircleOutlined />}
            />
          </Card>
        </Col>
        
        <Col xs={24} sm={12} md={6}>
          <Card>
            <Button 
              type="primary" 
              icon={<BugOutlined />}
              onClick={handleTriggerTest}
              block
            >
              Test AI Monitor
            </Button>
          </Card>
        </Col>
      </Row>

      <Card title="Recent Errors" loading={loading}>
        <Table
          columns={[
            {
              title: 'Time',
              dataIndex: 'timestamp',
              render: (timestamp) => new Date(timestamp).toLocaleString(),
            },
            {
              title: 'Type',
              dataIndex: 'type',
              render: (type) => <Tag color="red">{type.toUpperCase()}</Tag>
            },
            {
              title: 'Message',
              dataIndex: 'message',
              ellipsis: true
            }
          ]}
          dataSource={recentErrors.map(error => ({ ...error, key: error.id }))}
          pagination={{ pageSize: 10 }}
        />
      </Card>
    </div>
  );
};

export default AIDashboardPage;
